import React from "react";
import MakeItReal from "../../images/MakeItReal.png";
import Eafit from "../../images/Eafit.jpg";
import Reactjs from "../../images/Reactjs.png";

const Studies = () => {
  return (
    <div className="container-flow d-flex align-items-stretch studies">
      <div className="container d-flex flex-column justify-content-around">
        <div className="row border ">
          <h3 className="col-12 text-center">Studies</h3>
        </div>
        <div className="row border">
          <div className="col-12 container ">
            <div className="row justify-content-md-center">
              <div className="t col-3 d-flex flex-column m-2 p-2">
                <img className="img-fluid rounded-circle" src={Eafit} alt="" />
                <h5 className="text-center">
                  Product design engineer <br /> from <br /> EAFIT university
                </h5>
              </div>
              <div className="t col-3 d-flex flex-column m-2 p-2">
                <img
                  className="img-fluid rounded-circle"
                  src={MakeItReal}
                  alt=""
                />
                <h5 className="text-center">
                  Full Satck Developer <br /> from <br /> Make it Real camp
                </h5>
              </div>
              <div className="t col-3 d-flex flex-column m-2 p-2">
                <img className="img-fluid rounded-circle" src={Reactjs} alt="" />
                <h5 className="text-center">
                  React Developer <br /> from <br /> Make it Real camp
                </h5>
              </div>
            </div>
            <p className="row text-justify m-5">
              Constant learning on different platforms such as YouTube, Udemy,
              Codecademy, HackerRank ...
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Studies;

